const mapping = input.table_schema_mapping;
const body = input.body;

const result = {};

// 1) Map fields from body per table_schema_mapping
for (const [outKey, bodyKey] of Object.entries(mapping)) {
  result[outKey] = body?.[bodyKey];
}

// 2) Copy every other top-level key except "body" and "table_schema_mapping"
//    Don't overwrite keys already set from the mapping.
for (const [key, value] of Object.entries(input)) {
  if (key === 'body' || key === 'table_schema_mapping') continue;
  if (key in mapping) continue; // avoid clobbering mapped fields
  result[key] = value.trim();
}

return result;

